import React from 'react';
import './css/Note.css';

function NoteSearch({handleSearch}){
    return (
        <span>           
            <input onChange={(event) => handleSearch(event.target.value)}
            type='text' placeholder="Search..."/>
        </span>
    );
}

export default NoteSearch;
